import React from 'react'
import { Link } from 'react-router-dom';
import "./Header.css"
import logo from '../assets/images/logo.jpg'; // Import your logo image

const Header = () => {
  return (
    <header className='header'>
       <div className='logo'>
          <img src={logo} alt="Logo" style={{ borderRadius: '70%', width: '70px', height: '70px' }} />
        </div>
      <div>
        <div className='header-links'>
          <Link to="/product" className=''>Products</Link>
          <Link to="/product/cart" className=''><i class ="fas fa-shopping-cart"/>Cart</Link>&npsp;
          <Link to="/order" className=''><i class ="fas fa-shopping-cart"/>order</Link>
        </div>
       
      </div>
    </header>
  )
}

export default Header;
